import { useEffect, useState } from "react"

export default function Api(){
    const [data, setData] = useState({})

   

useEffect(() => {
    async function getData () {
        const response = fetch('data/data.json')
        const data = response.json
        setData(data)
    }
    getData()
},[])

return data

}
